2620. 计数器
Description
请你编写并返回一个 计数器 函数，它接收一个整型参数 n 。这个 计数器 函数最初返回 n，每次调用它时返回前一个值加 1 的值 ( n ,  n + 1 ,  n + 2 ，等等)。

示例 1：
输入：
n = 10
["call","call","call"]
输出：[10,11,12]
解释：
counter() = 10 // 第一次调用 counter()，返回 n。
counter() = 11 // 返回上次调用的值加 1。
counter() = 12 // 返回上次调用的值加 1。
示例 2：
输入：
n = -2
["call","call","call","call","call"]
输出：[-2,-1,0,1,2]
解释：counter() 最初返回 -2。然后在每个后续调用后增加 1。

提示：
-1000 
Solution

要实现一个计数器函数，需要在每次调用计数器函数时返回上一次返回的值加 1。由于需要记住上一次返回的值，可以使用闭包来实现。
定义一个变量 count，并将其初始化为 n。然后，返回一个闭包函数，该函数没有参数，并且返回值为一个数字。在闭包函数内部，将 count 的值加 1，然后返回 count 的当前值;
每次调用闭包函数时，它都会返回上一次调用返回的值加 1。因为 count 的值在闭包函数的作用域中，所以它会保留上一次调用的值，以便下一次调用时使用;

Code
/**
 * @param {number} n
 * @return {Function} counter
 */
// var createCounter = function (n) {
//     return function () {
//         return n++ // 注意n++ 和n=n+1的区别
//     };
// };

var createCounter = function (n) {
    let count = n;
    return function () {
        // 将 count 的值加 1
        count++;
        // 返回 count 的当前值
        return count;
    };
};

// createCounter=n=>_=>n++

const counter = createCounter(10)
counter()
counter()
let n = counter()
console.log(n)

