415. 字符串相加
Description
给定两个字符串形式的非负整数  num1 和 num2 ，计算它们的和并同样以字符串形式返回。
你不能使用任何內建的用于处理大整数的库（比如 BigInteger），  也不能直接将输入的字符串转换为整数形式。

示例 1：
输入：num1 = "11", num2 = "123"
输出："134"

示例 2：
输入：num1 = "456", num2 = "77"
输出："533"

示例 3：
输入：num1 = "0", num2 = "0"
输出："0"

提示：
1 
Solution

注意 JS 相加 17 位的问题，如 18582000000000000+873146362455 会得到 18582873146362456
方法就是模拟数相加，变成字符串相加，双指针分别指向两个数组的尾部，模仿数字相加。大于 10 要进 1，这个 1 会和下一次相累积。其相加之和 mod 10 的余数，会作为值添加到最后要的字符串中。

Code
/**
 * @param {string} num1
 * @param {string} num2
 * @return {string}
 */
var addStrings = function (num1, num2) {
    let p = num1.length - 1
    let q = num2.length - 1
    let cnt = 0, ans = '', sum = 0
    while (p >= 0 || q >= 0) {
        let num_p = 0
        let num_q = 0
        if (p >= 0) {
            num_p = Number(num1[p])
        }
        if (q >= 0) {
            num_q = Number(num2[q])
        }
        sum = num_p + num_q + cnt
        if (sum >= 10) {
            cnt = 1
        } else {
            cnt = 0
        }
        ans = (sum % 10) + ans
        p--
        q--
    }
    if (cnt === 1) {
        ans = '1' + ans
    }
    return ans
};


